import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-[#072679] text-white p-4 flex justify-between">
      <h1 className="font-bold text-lg">CricketXpert</h1>
      <div className="space-x-4">
        <Link to="/repair-form" className="hover:text-[#42ADF5]">Repair Form</Link>
        <Link to="/customer-dashboard" className="hover:text-[#42ADF5]">Customer Dashboard</Link>
        <Link to="/feedback" className="hover:text-[#42ADF5]">Feedback</Link>
      </div>
    </nav>
  );
};

export default Navbar;
